window.bookSummaryJSON = "<p>The best-selling post-apocalyptic epic adventure the Last Survivors - the complete series of six audiobooks in one bundle.&nbsp;</p> <p>Survival in manâ€™s second Dark Age.&nbsp;</p> <p>Three hundred years after the fall of society, the last fragments of civilization are clinging to life, living in the ruins of the ancient cities in medieval conditions. Technology has been reduced to legend, monsters roam the forests, and fear reigns supreme. But that is just the beginning.&nbsp;</p> <p>The wind-borne spores are spreading, disfiguring men and twisting their minds, turning them into creatures who threaten to destroy the townships. Among the townsfolk, political and the religious, dissension is spreading. Through it all, a mother must protect her son.&nbsp;&nbsp;</p> <p>The complete six-audiobook Last Survivors series.</p>"; 
